#include <cstdio>
#include <algorithm>
const char *s = "";
int ans[10001];
void solve() {
	int n;
	scanf("%d", &n);
	printf("%d\n", ans[n]);
}
int main() {
	for (int i = 1; i <= 10000; i++) sscanf(s + (i-1) * 2, "%02x", &ans[i]), ans[i] -= 100;
	for (int i = 2; i <= 10000; i++) ans[i] = ans[i] + ans[i-1];
	for (int i = 2; i <= 10000; i++) ans[i] = ans[i] + ans[i-1];
	int T; scanf("%d", &T);
	for (int i = 1; i <= T; i++)
		printf("Case %d: ", i), solve();
	return 0;
}